import './App.scss';
import { Experience, PreviousExperienceSet } from './components/PreviousExperience';

function App() {
  const arr:Experience[] = [
    {
      title: "System admin",
      dateRange: {
        from: "2021",
        to: "2022"
      },
      content: "fuck you"
    }
  ];
  return (
    <div className="App">
      <h1>Alex</h1>
      <PreviousExperienceSet arr />
    </div>
  );
}

export default App;
